import React from "react";

const AddNewMahi = (props) => {
    return (
        props.user.map((val, idx)=> {
            const userId = `user-${idx}`, emailId = `email-${idx}`

            return (
                <div key={idx}>
                    <label htmlFor={userId}>{`User #${idx + 1}`}</label>
                    <input
                        type="text"
                        name={userId}
                        data-id={idx}
                        id={userId}
                        value={props.user[idx].username} 
                        className="username"
                    />
                    <label htmlFor={emailId}>Email</label>
                    <input
                        type="email"
                        name={emailId}
                        data-id={idx}
                        id={emailId}
                        value={props.user[idx].email} 
                        className="email"
                    />
                </div>
            )
        })
    )
}
export default AddNewMahi
